let CACHE_NAME="wedding-cache-v1",urlsToCache=["/","/index.html","/css/styles.css","/js/script.js"];self.addEventListener("install",e=>{e.waitUntil(caches.open(CACHE_NAME).then(async e=>{for(var t of urlsToCache)try{await e.add(t)}catch(e){console.error(`Failed to cache ${t}:`,e)}}))}),self.addEventListener("activate",e=>(e.waitUntil(caches.keys().then(e=>Promise.all(e.filter(e=>e!==CACHE_NAME).map(e=>caches.delete(e))))),self.clients.claim())),self.addEventListener("fetch",t=>{t.respondWith(caches.match(t.request).then(e=>e||fetch(t.request)))});